</template>

<script>
import { isCurrentDay } from '@/common/utils';

export default {
    name: 'Week',
    computed: {
        color() {
            return this.$store.state.colors[Math.max(0, this.data.color - 1)][0];
        },
        doneProgressScale() {
            const p = this.$store.state.doneProgress;
            if (p <= 0.1) return 0;
            return 0.5 + 1.5 * (1.0 - p);
        },
    },
    methods: {
        isCurrent(d) {
            return isCurrentDay(d);
        },
        showDay(d) {
            if (d.msD > 0) {
                this.$emit('milestone', d);
            } else if (d.type === 'Checkpoint') {
                const toast = this.$f7.toast.create({
                    text: 'В этот день будет следующий шаг на данном Пути',
                    position: 'center',
                    cssClass: 'my-text-center',
                    closeTimeout: 2000,
                });
                toast.open();
                this.$store.commit('setToast', toast);
            }
        },
    },
    props: {
        days: {
            type: Array,
            required: true,
        },
        data: {
            type: Object,
            required: true,
        },
    },
};
</script>

